         <style>
            :root {
               --themeColor: #651fff;
               --txtColor: #251E44;
               --bg: #fff;
               --fontsize: 13px;
            }

            body {
               margin: 0;
               padding: 0;
               box-sizing: border-box;
               width: 100%;
               height: 100vh;
               font-family: sans-serif;
               background: #1e1e1e;
            }

            .container {
               box-sizing: border-box;
               width: 100%;
               height: auto;
               color: var(--txtColor);
               font-size: 1rem;
               overflow: hidden;
            }

            h1 {
               position: relative;
               top: -7em;
               box-sizing: border-box;
               margin: 0;
               padding: 1em;
               text-align: center;
               color: ghostwhite;
               font-size: 1.5em;
            }

            p {
               box-sizing: border-box;
               margin: 0;
               padding: 1em;
               text-align: center;
               color: ghostwhite;
               font-size: 1.5em;
            }

            .tabContainer {
               position: relative;
               left: 50%;
               transform: translateX(-50%);
               width: 90%;
               height: auto;
            }

            #textarea {
               position: relative;
               top: -13em;
               left: 50%;
               transform: translateX(-50%);
               min-width: 90%;
               min-height: 5em;
               box-sizing: border-box;
               padding: 5%;
               background: ghostwhite;
               border: 0;
               color: var(--txtColor);
               border-radius: 5px;
               box-shadow: 0px 10px 20px #3e3e3e;
               overflow: hidden;
               outline: none;
            }


            #kopya {
               position: relative;
               left: 50%;
               top: -11em;
               transform: translateX(-50%);
               display: grid;
               place-items: center;
               width: 10em;
               height: 2.5em;
               margin: 5% 0;
               border-radius: 5px;
               background: #ffa60d;
               box-shadow: 0 10px 20px rgba(0, 0, 0, 0.1);
               color: #fff;
               font-weight: bold;
               text-transform: uppercase;
               letter-spacing: 2px;
            }

            .tags {
               display: grid;
               place-items: center;
               color: #fff;
               font-weight: bold;
               font-size: var(--fontsize);
               letter-spacing: 2px;
               border-radius: 50px;
               background: #ff7675;
               width: auto;
               height: 2em;
               margin: 2%;
               padding: 0.5em 1em;
            }

            .select {
               background: #d63031;
            }

            .description {
               position: relative;
               left: 50%;
               transform: translateX(-50%);
               width: 80%;
               color: ghostwhite;
               padding-bottom: 2em;
            }

            .right {
               position: relative;
               bottom: -20px;
               width: 100%;
               color: ghostwhite;
               text-align: center;
               padding: 0.3em;
               margin-top: auto;
               font-weight: 500;
               background: rgba(0, 0, 0, 0.2);
            }

            #myFrame {
               width: 0%;
               height: 0%;
               opacity: 1%;
            }
         </style>
      </div>
   </div>
</body>

</html>
